    const old = {} //存放老dom的属性
    const attrs = vnode.attrs //当前虚拟dom的属性

    for(let i = 0;i< dom.attributes.length;i++){
        const attr = dom.attributes[i]
        old[attr.name] = attr.value
    }

    for(let name in old) {
        //如果以前的属性不在虚拟属性中 移除以前的属性
